import React from 'react';

<link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css"></link>;

const Customs = () => {
  return (
    <>
      관세법인 에이원은고객과 함께할 준비가 되었습니다.
      <br />
      [문의하기] 버튼을 클릭하시어 에이원의 프로팀과 지금 상의하세요!
      <br />
      <br />
      <a href="http://www.aonecustoms.com/inquiry/" class="w3-button w3-black">
        문의하기
      </a>
      <br />
      <br />
      관세무역 자료실!!
      <br />
      [바로가기]버튼을 클릭하시면 보다 많은 정보를 얻으실 수 있습니다.
      <br />
      <br />
      <a href="/Resources2" class="w3-button w3-black">
        바로가기
      </a>
      <br />
      <br />
    </>
  );
};

export default Customs;
